css:
@-moz-document url-prefix("https://www.youtube.com"), domain("youtube.com") {

.ytp-large-play-button-red-bg .ytp-large-play-button-bg {
    fill: #ff0;
    fill-opacity: 1;
}

ytd-thumbnail #thumbnail.ytd-thumbnail {
    border: 1px solid #ffa;
   box-shadow: 0px 0px 2px yellow, 0px 0px 2px yellow, 0px 0px 2px yellow !important;
}

yt-formatted-string.style-scope.ytd-rich-grid-media {
  color: yellow;
}

/* [darker-dark-theme][dark], [darker-dark-theme] [dark] */

html {
  --yt-spec-text-primary: yellow  !important;
    --yt-spec-text-primary-inverse: #0f0f0f  !important;

--yt-spec-call-to-action: #ffc107  !important;

--yt-spec-commerce-filled-hover: #a57b00  !important ;

--yt-spec-text-secondary: #c1b12a  !important;

--yt-spec-suggested-action: #0f0f0f  !important;

--yt-spec-static-overlay-background-brand: #ffc107  !important;

--yt-spec-static-brand-white: yellow  !important;

--yt-spec-icon-inactive: yellow  !important;

--yt-spec-static-brand-red: yellow  !important;

}

html, [light] {
    --yt-spec-base-background: black  !important;

--yt-spec-menu-background: black  !important;
    --yt-spec-text-primary-inverse: black !important;

--yt-spec-brand-background-primary: black  !important;

  /* search */
    --ytd-searchbox-legacy-border-shadow-color: black  !important;
    --ytd-searchbox-legacy-button-color: black  !important;
    
--ytd-searchbox-legacy-button-hover-color: black  !important;

--yt-spec-general-background-a: black  !important;
}

path {
  fill: yellow !important;
}

/*Youtube premium*/

svg g g > path {
  fill: none;
}

svg g g g > path {
  fill: yellow;
} 

svg g g g > path + path {
  fill: black;
} 

/* Youtube Music Logo */
svg circle {
  fill: yellow;
}

svg polygon {
  fill: black;
}

svg polygon + path {
  fill: black;
}

/* creator studio  */

svg g > path:nth-child(2)  {
  fill: black;
}


svg g > path:nth-child(4)  {
  fill: black;
}

/* fullscreen */
.ytp-fullscreen-button svg g path {
  fill: yellow;
}

/* Icono de youtube */

button.ytp-large-play-button svg path:nth-child(2) {
  fill: black !important;
}

/* Fin de los iconos */

.ytp-chrome-controls .ytp-button[aria-pressed]:after {
  background-color: yellow;
}

.ytp-panel-menu {
  color: yellow;
}

ytd-searchbox[desktop-searchbar-style=rounded_corner_borders_light_btn] #container.ytd-searchbox {
  border: 1px solid #ffa;
   box-shadow: 0px 0px 5px yellow, 0px 0px 5px yellow, 0px 0px 5px yellow !important;
}

ytd-searchbox[desktop-searchbar-style=rounded_corner_borders_light_btn] #search-icon-legacy.ytd-searchbox {
    border: 1px solid #ffa;
   box-shadow: 0px 0px 5px yellow, 0px 0px 5px yellow, 0px 0px 5px yellow !important;
}

.sbsb_a {
    background: black;
}

.gsfs {
    color: yellow;
}

.gsfs:hover {
    background-color: #36331a !important;
}

.sbdd_b {
  border: 1px solid yellow;
  border-top: none;
}

.sbpqs_a {
    color: #ffc107;
}

.sbpqs_a b {
  color: yellow;
}

.sbsb_i {
    color: #ffc107;
}

#container.ytd-searchbox input.ytd-searchbox {
    color: yellow  !important;
}

input::placeholder {
  color: #ff0  !important;
}


.sbpqs_a:before {
    background: no-repeat url(https://i.imgur.com/ZR307RZ.png);
    background-size: 15px auto;
}

.sbqs_c:before {
    background: no-repeat url(https://i.imgur.com/Po0Y5ms.png);
    background-size: 15px auto;
}

.yt-spec-icon-badge-shape--type-notification .yt-spec-icon-badge-shape__badge {
    background-color: yellow;
    color: #000;
}

.html5-video-player {
  color: yellow;
}

.ytp-spinner-circle {
    border-color: yellow transparent yellow transparent;
}

::-webkit-scrollbar {
  width: 12px !important;
  background-color: black;
}

::-webkit-scrollbar-thumb {
  background: black  !important;
  background-clip: padding-box;
  border: 1px solid yellow  !important;
  border-radius: 8px;
  box-shadow: none;
  min-height: 35px;
  width: 10px  !important;
}

ytd-thumbnail-overlay-time-status-renderer {
 background-color: yellow;
 }

#text.ytd-thumbnail-overlay-time-status-renderer {
  color: black;
}

yt-notification-action-renderer[ui-refresh] #text.yt-notification-action-renderer, yt-notification-action-renderer[ui-refresh] #sub-text.yt-notification-action-renderer {
    color: yellow;
}

.ytp-flyout-cta .ytp-flyout-cta-action-button.ytp-flyout-cta-action-button-rounded {
    background: #ff9800;
}

.iv-card-content {
    background-color: black;
    color: #ffc107;
}
.iv-card-content:hover>:first-child {
    background-color: black;
    color: #ddcc01;
}

.iv-card-content>:first-child {
    color: yellow;
}

/* LIKE ICON
yt-animated-icon[animated-icon-type="LIKE"] svg g path {
  fill: red;
  color: red;
  background-color: red;
  border-color: red;

} */

.badge-style-type-live-now-alternate.ytd-badge-supported-renderer span.ytd-badge-supported-renderer {
    color: black;
}

/* Youtube LOGO JEDI */ 
html #logo-red-icon,
html #logo-icon {
  content: url("data:image/svg+xml;base64,")  !important; 
  background-image: none !important;
  width: 165px;
  height:35px;
}

/* Star wars lightsaver amarillo */

/* Video progress bar */
.html5-play-progress, .ytp-play-progress {
   background: yellow;
   background: linear-gradient(to bottom, yellow 0%,#ffffff 24%,#ffffff 65%,yellow 100%);
   box-shadow: 0px 0px 20px yellow, 0px 0px 20px yellow, 0px 0px 20px yellow !important;
}

/* resume bar */
#progress.ytd-thumbnail-overlay-resume-playback-renderer {
  background: yellow;
   background: linear-gradient(to bottom, yellow 0%,#ffffff 24%,#ffffff 65%,yellow 100%);
   box-shadow: 0px 0px 20px yellow, 0px 0px 20px yellow, 0px 0px 20px yellow !important;
}

   

   /* Barre de chargement */    /* Video load bar */
.html5-load-progress, .ytp-load-progress {
   background: #70B9FF;
   background: -moz-linear-gradient(top, rgba(120, 120, 120, 0.3) 0%, rgba(120, 120, 120, 0.3) 45%,  rgba(255, 255, 255, 0.3) 55%, rgba(120, 120, 120, 0.3) 100%);
   background: -webkit-linear-gradient(top, rgba(120, 120, 120, 0.3) 0%, rgba(255, 255, 255, 0.3) 45%, rgba(255, 255, 255, 0.3) 55%,rgba(120, 120, 120, 0.3) 100%);
   background: linear-gradient(to bottom, rgba(120, 120, 120, 0.3) 0%, rgba(255, 255, 255, 0.3) 40%, rgba(255, 255, 255, 0.3) 55%,rgba(120, 120, 120, 0.3) 100%);
   box-shadow: 0px 0px 12px rgba(120, 120, 120, 0.3), 0px 0px 12px rgba(120, 120, 120, 0.3), 0px 0px 12px rgba(120, 120, 120, 0.3) !important;
}

 
/* Bouton de scroll */    /* Scrubber button */
.html5-scrubber-button, .ytp-scrubber-button {
   background: rgba(255, 255, 255, 0)  !important;
   border-color: rgba(255, 255, 255, 0)  !important;
   box-shadow: 0px 0px 0px rgba(255, 255, 255, 0), 0px 0px 0px rgba(255, 255, 255, 0), 0px 0px 0px rgba(255, 255, 255, 0) !important;
   transition: box-shadow 0.0s, background 0.0s !important;
}
/* Boutton de scroll — hover */    /* Scrubber button — hover */
.html5-scrubber-button:hover, .ytp-scrubber-button:hover {
   background: #FFFFFF !important;
   background: -moz-radial-gradient(center, ellipse cover, #ffffff 0%, #ffffff 20%, yellow 100%) !important;
   background: radial-gradient(ellipse at center, #ffffff 0%,#ffffff 20%,yellow 100%) !important;
   border-color: #ffffff !important;
   box-shadow: 0px 0px 10px yellow, 0px 0px 12px yellow, 0px 0px 14px yellow !important; 
}
   
/* Réglage volume /    / Volume control bar */
.ytp-volume-slider-handle {
   background: yellow !important;
   background: -moz-linear-gradient(left, yellow  0%, yellow  35%, #ffffff 65%, yellow  100%) !important;
   background: linear-gradient(to right, yellow 0%,#ffffff 24%,#ffffff 65%,yellow 100%) !important;
   box-shadow: 0px 0px 10px yellow, 0px 0px 10px yellow, 0px 0px 10px yellow !important;
}

.ytp-volume-slider-handle:before,.ytp-volume-slider-handle:after {
   background: #ffffff !important;
   background: -moz-linear-gradient(top, yellow 0%, yellow 35%, #ffffff 65%, yellow 100%) !important;
   background: -webkit-linear-gradient(top, yellow 0%,#ffffff 35%,#ffffff 65%,yellow 100%) !important;
   background: linear-gradient(to bottom, yellow 0%,#ffffff 24%,#ffffff 65%,yellow 100%) !important;
/*   box-shadow: 0px 0px 5px #ED0000, 0px 0px 5px #ED0000, 0px 0px 5px #ED0000 !important;*/
	width:50px;
   margin-left:-50px;
}
.ytp-volume-slider-handle:after {
	left:0px;
	background:rgba(255,255,255,.2)
}
.ytp-big-mode .ytp-volume-slider-handle:after {
	left:-46px;
	background:rgba(255,255,255,.2)
}
   
/* Item coché */    /* Checked item */
.ytp-menuitem[aria-checked="true"] .ytp-menuitem-toggle-checkbox, .ytp-autonav-toggle-button[aria-checked="true"] {
   background: -moz-radial-gradient(center, ellipse cover, #ffffff 0%, #ffffff 20%, yellow 100%) !important;
   background: radial-gradient(ellipse at center, #ffffff 0%,#ffffff 20%,yellow 100%) !important;
   box-shadow: 0px 0px 10px yellow, 0px 0px 12px yellow, 0px 0px 14px yellow !important;
   content:'';
}
   
/* Item décoché */    /* Unchecked item */
.ytp-menuitem[aria-checked="false"] .ytp-menuitem-toggle-checkbox, .ytp-autonav-toggle-button[aria-checked="false"] {
   background: radial-gradient(ellipse at center, #bbb 0%,#bbb 20%,#aa0 100%) !important;
   content:'';
}

.ytp-time-current, .ytp-time-separator, .ytp-time-duration {
  color: yellow;
}

}
